        <h1 className='text-[40px] font-bold text-white'>Simple Weather App</h1>

        <form>
          <input type='text' className='w-[300px] h-[40px] pl-3' placeholder='Enter City' /><button className='bg-blue-800 border-black m-4 p-3 font-bold'>Submit</button>
        </form>

      </div>
    </div>
  );
}

export default App;
